import React from 'react';

function Home(){

    return(
        <div className='Homepagewrapper'>
            <div className='formwrapper'>
                <img src='/V chat.png'/>
                <h4 className='label'>Real time Code editor</h4>
                <div className='inputGroup'>
                    <input type="text" placeholder="ROOM ID" className='Roomid'></input>
                    <input type="text" placeholder = "Username" className='Username'></input>
                    <button className='btn joinBtn'>Join</button>
                    <span className='createInfo'>
                        If you don't have any invite then create your room here &nbsp;
                        <a href='' className='createnewbtn'>New Room</a>
                    </span>
                </div>
                <button></button>
            </div>
            <footer>
                {/* <h4>Buit with <img src='/V chat.png' className='logo'></img> chat</h4> */}
            </footer>
        </div>
    )
}
export default Home;
